◆【日本製】 18-0ステンレス製のトルテカッターです。<br>
◆トルテを均等に切り分けできる便利なケーキ金型です。<br>
◆ホールケーキにカットする位置の印をつけるのにも使われています。<br>
◆耐腐食性・耐久性に優れた18-0ステンレス製。丈夫で長持ち！<br>
◆業務用はもちろん、ご家庭でのお菓子作りにも最適！<br>
